import React from "react";

function WelcomeF(props) {
    return (
    <p>Hello, {props.userName}!</p>
)}

class Welcome extends React.Component {
    render() {
        return (
            <div>
                <WelcomeF userName='Misha' />
                <WelcomeF userName='Danya' />
                <WelcomeF userName='Dima' />
            </div>
        )
    }
}

export default Welcome;
